import styled from "styled-components";

export const EmptyContainer = styled.div`
  color: black !important;
  
  display: flex;
  flex-direction: column;

  height: calc(100vh - 90px);

  justify-content: center;
  align-items: center;

  font-size: 1.5rem;

`;
